import React, { Component } from 'react'
import axios from 'axios'

export default class DashBoard extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             posts: [],
             data: {
                 user: '1',
                 person: '22'
             }
        }
    }

    componentDidMount() {
        axios.get(this.state.data)
        .then(response => {
            console.log(response)
        })
        .catch(error => {
            console.log(error)
        })
    }
    
    render() {
        return (
            <div>
               <h1>DashBoard with data: </h1>
            </div>
        )
    }
}
